SQL_Query:
SELECT ROUND(COALESCE(COALESCE(sum(REPAYMENT_DURING_MONTH),0)/10000000,0),2) AS FINAL_OUTPUT
FROM DISHA_MART_ANALYTICS.REGULATORY_MART.OUTSTANDING_MART
WHERE UPPER(TRIM(NHB_PRODUCT)) IN ('OTHER LOAN')
  AND COALESCE(UPPER(TRIM(Customer_type)),'') NOT IN ('INDIVIDUAL', 'CORPORATE')
  AND REPORT_DATE = {{report_dates}}
  AND COALESCE(REPAYMENT_DURING_MONTH,0)>0;

SELECT COUNT(LOAN_NUMBER_NEW) AS FINAL_OUTPUT
FROM DISHA_MART_ANALYTICS.REGULATORY_MART.OUTSTANDING_MART
WHERE UPPER(TRIM(NHB_PRODUCT)) IN ('OTHER LOAN')
  AND COALESCE(UPPER(TRIM(Customer_type)),'') NOT IN ('INDIVIDUAL', 'CORPORATE')
  AND REPORT_DATE = {{report_dates}}
  AND TRIM(Asset_classification_Ind_AS) = 'Stage 3';

SELECT ROUND(COALESCE(sum(NHL_bifurcation_of__EAD)/10000000,0),2) AS FINAL_OUTPUT
FROM DISHA_MART_ANALYTICS.REGULATORY_MART.OUTSTANDING_MART
WHERE UPPER(TRIM(NHB_PRODUCT)) IN ('OTHER LOAN')
  AND COALESCE(UPPER(TRIM(Customer_type)),'') NOT IN ('INDIVIDUAL', 'CORPORATE')
  AND REPORT_DATE = {{report_dates}}
  AND TRIM(Asset_classification_Ind_AS) = 'Stage 3';

SELECT ROUND(COALESCE(sum(case 
    when UPPER(TRIM(Customer_type)) = 'INDIVIDUAL' AND DATE_TRUNC('MONTH',LOAN_AUTHOR_DATE)<DATE_TRUNC('MONTH',DATE{{report_dates}}) THEN NHL_BIFUR_OF_SANCTION_AMT
    when UPPER(TRIM(Customer_type)) = 'CORPORATE' AND CRE_RH_TAGGING is not null AND DATE_TRUNC('MONTH',LOAN_AUTHOR_DATE)<DATE_TRUNC('MONTH',DATE{{report_dates}}) THEN NHL_BIFUR_OF_SANCTION_AMT end
    )/10000000,0),2) AS FINAL_OUTPUT
FROM DISHA_MART_ANALYTICS.REGULATORY_MART.SANCTION_PERIOD_MART_V1
WHERE  REPORT_DATE ={{report_dates}};

SELECT ROUND(COALESCE(sum(case 
    when UPPER(TRIM(Customer_type)) = 'INDIVIDUAL' THEN NHL_BIFUR_OF_SANCTION_AMT
    when UPPER(TRIM(Customer_type)) = 'CORPORATE' AND CRE_RH_TAGGING is not null  THEN NHL_BIFUR_OF_SANCTION_AMT end
    )/10000000,0),2) AS FINAL_OUTPUT
FROM DISHA_MART_ANALYTICS.REGULATORY_MART.SANCTION_PERIOD_MART_V1
WHERE  REPORT_DATE ={{report_dates}};
